import React from 'react';
import './container.css';
import IMG_1 from '../../data_photo/IMG_1.jpg';

const Container = () => {
	return(
		<div className='container'>

	   <img 
	   className='image'
	   alt='robots'
	   src={IMG_1} />
			
		</div>
		);

}

export default Container;
